def getLines(btFilePathsList, verbose=False):
    total = 0
    flagDict = {}
    langDict = {}
    domainDict = {}
    for index, filePath in enumerate(btFilePathsList):
        if index % 100000 == 0: #########################
            print(index) ######################
        fSplit = filePath.split(u'/')
        #open the score file and count
        with open(filePath) as file:
            # get to the actual data line
            line = file.readline()
            while line:
                # populate the total dict
                total += 1
                # populate the flag dict
                flagDict = populateDict1(fSplit[-4], flagDict)
                # populate the domain dict
                domainDict = populateDict1(fSplit[-3], domainDict)
                # populate the lang dict
                langDict = populateDict1(fSplit[-2], langDict)
                # get next line
                line = file.readline()
    if verbose != False:
        print(11111111, 'Total Dict')
        print(total)
        print(22222222, 'Flag Dict')
        print(flagDict)
        print(33333333, 'Domain Dict')
        print(domainDict)
        print(44444444, 'Lang Dict')
        print(langDict)
    return total, flagDict, domainDict, langDict


def getMoreStats(btFilePathsList):
    """
    - % de tmx avec n paires de phrases
    - % longueur moyenne des phrases (source / cible)
    - % moyenne de ratio de longueur (en mot, en caracteres) dans les paires de phrases (stat par répertoire)
    - % de paires de phrases ayant un ratio de longueur inférieur (ou supérieur) a une valeur donee (stat par repertotire)
    Ces deux derniers dans le but de mesurer un signal brut
    - Vocabulaire total (source / cible)
    - % hapax words (source / cible)
    """
    pairsDict = {} #tmx by sentence pairs
    sentenceLengthDict = {u'char origin': 0,
                          u'char target': 0,
                          u'token origin': 0,
                          u'token target': 0,
                          u'char en': 0,
                          u'char fr': 0,
                          u'token en': 0,
                          u'token fr': 0,
                          u'char total': 0,
                          u'token total': 0}
    #lengthRatioDict = {u'orig-target' = [], u'en-fr' = [], u'fr-en' = []}
    vocDict = {'en': {}, 'fr': {}}
    #starting
    for index, filePath in enumerate(btFilePathsList):
        filePathEn = u'{0}.en'.format(filePath)
        filePathFr = u'{0}.fr'.format(filePath)
        fSplit = filePath.split(u'/')

        # ENGLISH open the score file and count
        with open(filePathEn) as fileEn:
            # get to the actual data line
            lineEn = fileEn.readline().replace(u'\n', u'')
            nbSent = 0
            while lineEn:
                # count for the pairs dict
                nbSent += 1
                # populate the voc dict
                tokens = word_tokenize(lineEn)
                for token in tokens:
                    if token not in vocDict[u'en']:
                        vocDict[u'en'][token] = 1
                    else:
                        vocDict[u'en'][token] += 1
                # populate the sentence length dict
                sentenceLengthDict[u'char en'] += len(lineEn)
                sentenceLengthDict[u'token en'] += len(tokens)
                if fSplit[-2] == u'en-fr':
                    sentenceLengthDict[u'char origin'] += len(lineEn)
                    sentenceLengthDict[u'token origin'] += len(tokens)
                else:
                    sentenceLengthDict[u'char target'] += len(lineEn)
                    sentenceLengthDict[u'token target'] += len(tokens)
                sentenceLengthDict[u'char total'] += len(lineEn)
                sentenceLengthDict[u'token total'] += len(tokens)
                # next line
                lineEn = fileEn.readline().replace(u'\n', u'')
            # populate the pairs dict
            if nbSent not in pairsDict:
                pairsDict[nbSent] = 1
            else:
                pairsDict[nbSent] += 1

        # FRENCH open the score file and count
        with open(filePathFr) as fileFr:
            # get to the actual data line
            lineFr = fileFr.readline().replace(u'\n', u'')
            nbSent = 0
            while lineFr:
                # count for the pairs dict
                nbSent += 1
                # populate the voc dict
                tokens = word_tokenize(lineFr)
                for token in tokens:
                    if token not in vocDict[u'fr']:
                        vocDict[u'fr'][token] = 1
                    else:
                        vocDict[u'fr'][token] += 1
                # populate the sentence length dict
                sentenceLengthDict[u'char fr'] += len(lineFr)
                sentenceLengthDict[u'token fr'] += len(tokens)
                if fSplit[-2] == u'fr-en':
                    sentenceLengthDict[u'char origin'] += len(lineFr)
                    sentenceLengthDict[u'token origin'] += len(tokens)
                else:
                    sentenceLengthDict[u'char target'] += len(lineFr)
                    sentenceLengthDict[u'token target'] += len(tokens)
                sentenceLengthDict[u'char total'] += len(lineFr)
                sentenceLengthDict[u'token total'] += len(tokens)
                # next line
                lineFr = fileFr.readline().replace(u'\n', u'')
            # populate the pairs dict
            if nbSent not in pairsDict:
                pairsDict[nbSent] = 1
            else:
                pairsDict[nbSent] += 1
    print('more stats saved at ./temp.txt')
    utilsOs.dumpRawLines([u'selection', btFilePathsList, '\nPairs Dict', pairsDict, '\nSentence length Dict', sentenceLengthDict, '\nVoc Dict', vocDict], u'./temp.txt')
    return pairsDict, sentenceLengthDict, vocDict


def getSentPairStats(btFilePathsList):
    """
    - % moyenne de ratio de longueur (en mot, en caracteres) dans les paires de phrases (stat par répertoire)
    - % de paires de phrases ayant un ratio de longueur inférieur (ou supérieur) a une valeur donee (stat par repertotire)
    Ces deux derniers dans le but de mesurer un signal brut
    """
    lengthRatioDict = {} # ratio of english char and tokens over all
    #starting
    for index, filePath in enumerate(btFilePathsList):
        filePathEn = u'{0}.en'.format(filePath)
        filePathFr = u'{0}.fr'.format(filePath)
        fSplit = filePath.split(u'/')
        # ENGLISH open the score file and count
        with open(filePathEn) as fileEn:
            with open(filePathFr) as fileFr:
                if fSplit[-4] not in lengthRatioDict:
                    lengthRatioDict[fSplit[-4]] = {u'char': [], 'token': []}
                # get to the actual data line
                lineEn = fileEn.readline().replace(u'\n', u'')
                lineFr = fileFr.readline().replace(u'\n', u'')
                while lineEn or lineFr:
                    #both lang
                    if lineEn and lineFr:
                        # get the data
                        tokensEn = len(word_tokenize(lineEn))
                        tokensFr = len(word_tokenize(lineFr))
                        charEn = len(lineEn)
                        charFr = len(lineFr)
                        # populate the dict
                        lengthRatioDict[fSplit[-4]][u'char'].append(float(charEn)/float(charFr))
                        lengthRatioDict[fSplit[-4]][u'token'].append(float(tokensEn)/float(tokensFr))
                        #next line
                        lineEn = fileEn.readline().replace(u'\n', u'')
                        lineFr = fileFr.readline().replace(u'\n', u'')
                    # only en
                    elif lineEn:
                        lengthRatioDict[fSplit[-4]][u'char'].append(1.0)
                        lengthRatioDict[fSplit[-4]][u'token'].append(1.0)
                        # next line
                        lineEn = fileEn.readline().replace(u'\n', u'')
                    # only fr
                    elif lineFr:
                        lengthRatioDict[fSplit[-4]][u'char'].append(0.0)
                        lengthRatioDict[fSplit[-4]][u'token'].append(0.0)
                        # next line
                        lineFr = fileFr.readline().replace(u'\n', u'')
    for flagFolder, subDict in lengthRatioDict.items():
        print(111111111, flagFolder)
        print(200000000, u'character ratio', sum(subDict[u'char'])/len(subDict[u'char']))
        #print(222222222, subDict[u'char'])
        print(300000000, u'token ratio', sum(subDict[u'token'])/len(subDict[u'token']))
        #print(333333333, subDict[u'token'])
        print()
    utilsOs.dumpDictToJsonFile(lengthRatioDict, './temp.json', True)
    return lengthRatioDict


def populateDict1(key, aDict={}):
    if key not in aDict:
        aDict[key] = 1
    else:
        aDict[key] += 1
    return aDict


def populateDict2(key, score, aDict={}):
    if key not in aDict:
        aDict[key] = {'0': 0, '1': 0}
        aDict[key][score] += 1
    else:
        aDict[key][score] += 1
    return aDict


def getScoreParallel(filesPath, verbose=False):
    """ get the scores of the right paralel correspondence """
    totalDict = {}
    flagDict = {}
    langDict = {}
    domainDict = {}
    # censing the files in the scores folders
    for folder in [u'ALIGNMENT-QUALITY', 'MISALIGNED', 'NOT-FLAGGED', 'QUALITY']:
        for filePath in utilsOs.goDeepGetFiles(u'{0}/{1}/'.format(filesPath, folder)):
            fSplit = filePath.split(u'/')
            #open the score file and count
            with open(filePath) as scoreFile:
                # pass the header line
                line = scoreFile.readline()
                # get to the actual data line
                line = scoreFile.readline()
                while line:
                    # get the score
                    score = line.replace(u'\n', u'').split(u',')[-1]
                    # populate the total dict
                    totalDict = populateDict1(score)
                    # populate the flag dict
                    flagDict = populateDict2(fSplit[-4], score, flagDict)
                    # populate the domain dict
                    domainDict = populateDict2(fSplit[-3], score, domainDict)
                    # populate the lang dict
                    langDict = populateDict2(fSplit[-2], score, langDict)
                    # get next line
                    line = scoreFile.readline()
    if verbose != False:
        print(11111111, 'Total Dict')
        print(totalDict)
        print(22222222, 'Flag Dict')
        print(flagDict)
        print(33333333, 'Domain Dict')
        print(domainDict)
        print(44444444, 'Lang Dict')
        print(langDict)
    return totalDict, flagDict, domainDict, langDict


def launchYasa(sourceFilePath, targetFilePath):
    """ launches YASA from python and gets the terminal output """
    process = Popen(["./yasa-master/src/yasa", "-i", "o", "-o", "r", sourceFilePath, targetFilePath], stdin=PIPE, stdout=PIPE)
    return process.communicate(timeout=60)


def launchYasaAndDumpResults(btFilePathsList):
    """ given a list of the bt files, it applies the yasa algorithm and saves the results in a different folder """
    for filePath in  btFilePathsList:
        # get the path to the yasa output
        yasaOutputPath = filePath.replace(u'/data/rali8/Tmp/rali/bt/burtrad/corpus_renamed/', u'./yasa/yasa4BtOutput/')
        # if that output already exists, then we go to the next one
        if utilsOs.theFileExists(yasaOutputPath) is False:
            # get the source and target file paths
            sourceFilePath = u'{0}.en'.format(filePath) if u'en-fr' in filePath else u'{0}.fr'.format(filePath)
            targetFilePath = u'{0}.fr'.format(filePath) if u'en-fr' in filePath else u'{0}.en'.format(filePath)
            # launch yasa get the output from the terminal
            out, errs = launchYasa(sourceFilePath, targetFilePath)
            # if there is no error
            if errs is None:
                out = out.decode(u'utf-8')
                out = out[:-2] if out[-2:] == u'\n' else out
                out = out.replace(u' ', u'\t')
                utilsOs.dumpRawLines(out.split(u'\n'), yasaOutputPath)
            else:
                print(10000, filePath)
                print(11111, out)
                print(22222, type(errs))
    return


def getScoreYasa(filesPath, pathToPreexistingSample, verbose=False):
    """ get the scores of the right paralel correspondence """
    totalDict = {}
    flagDict = {}
    langDict = {}
    domainDict = {}
    # censing of the files in the scores folders to match as much as possible a preexisting sample
    secondaryFilesPath = list(utilsOs.goDeepGetFiles(filesPath))
    primaryFilesPath = utilsOs.goDeepGetFiles(pathToPreexistingSample)
    # for each path in the list
    for index, filePath in enumerate(primaryFilesPath):
        # want to match and limit the scoring stats to a sample matching as much as possible a preexisting sample
        if pathToPreexistingSample != None:
            filePath = filePath.replace(u'/u/bhardwas/bt/', u'./yasa/yasa4BtOutput/') #########################
            if utilsOs.theFileExists(filePath) is False:  ############
                filePath = secondaryFilesPath[index] ######################
        fSplit = filePath.split(u'/')
        scorePath = u'./yasa/yasa4BtOutput/{0}/{1}/{2}/{3}'.format(fSplit[-4], fSplit[-3], fSplit[-2], fSplit[-1])
        #open the score file and count
        with open(scorePath) as scoreFile:
            # first line
            line = scoreFile.readline()
            while line:
                # get the score
                alignment = line[:3]
                score = u'1' if alignment == u'1-1' else u'0'
                # populate the total dict
                totalDict = populateDict1(score)
                # populate the flag dict
                flagDict = populateDict2(fSplit[-4], score, flagDict)
                # populate the domain dict
                domainDict = populateDict2(fSplit[-3], score, domainDict)
                # populate the lang dict
                langDict = populateDict2(fSplit[-2], score, langDict)
                # get next line
                line = scoreFile.readline()
    if verbose != False:
        print(11111111, 'Total Dict')
        print(totalDict)
        print(22222222, 'Flag Dict')
        print(flagDict)
        print(33333333, 'Domain Dict')
        print(domainDict)
        print(44444444, 'Lang Dict')
        print(langDict)
    return totalDict, flagDict, domainDict, langDict


def shuffleBtList(btList):
    tempList = []
    for folder in [u'ALIGNMENT-QUALITY', u'MISALIGNED', u'NOT-FLAGGED', u'QUALITY']:
        folderList = [fp for fp in btList if folder in fp]
        shuffle(folderList)
        #get a representative size of the list
        magnitude = len(str(len(folderList)))
        if magnitude >= 7:
            size = int((len(folderList) / 3000)*2)
        elif magnitude <= 3:
            size = 10
        else:
            size = int(len(folderList) / 15)
        #add to tempList
        tempList = tempList + folderList[:100] + folderList[101:100+size]
    shuffle(tempList)
    return tempList[:1000]


def getIndexCorrespondToYasaScore(pathToYasaScoreFile):
    """ given a path to a file containing the yasa score it returns
    a list of the indexes corresponding to the alignment detection """
    fileIndexes = [0,0]
    listOfIndexes = []
    with open(pathToYasaScoreFile) as yasaFile:
        line = yasaFile.readline()
        while line:
            if len(line) not in [0,1]:
                # get the yasa score
                score = line.replace(u'\n', u'').split(u'\t')[0]
                scoreToIndex = [None, None]
                # get the index to the score of the first sentence in the sentence pair

                if score[0] == u'1':
                    scoreToIndex[0] = fileIndexes[0]
                    # indicate that the index has changed
                    fileIndexes[0] += 1
                elif score[0] == u'2':
                    scoreToIndex[0] = (fileIndexes[0], fileIndexes[0]+1)
                    # indicate that the index has changed
                    fileIndexes[0] += 2
                # get the index to the score of the second sentence in the sentence pair
                if score[-1] == u'1':
                    scoreToIndex[1] = fileIndexes[1]
                    # indicate that the index has changed
                    fileIndexes[1] += 1
                elif score[-1] == u'2':
                    scoreToIndex[1] = (fileIndexes[1], fileIndexes[1]+1)
                    # indicate that the index has changed
                    fileIndexes[1] += 2
                # add the scores to index to the final list
                listOfIndexes.append(scoreToIndex)
            # next line
            line = yasaFile.readline()
    return listOfIndexes


def getYasaScoreForIndex(shivFileIndex, yasaIndexList):
    """ """
    for yasaTupl in yasaIndexList:
        # get first index yasa as list
        if type(yasaTupl[0]) is int or yasaTupl[0] == None:
            firstIndexYasa = [yasaTupl[0]]
        else:
            firstIndexYasa = yasaTupl[0]
        # get second index yasa as list
        if type(yasaTupl[1]) is int or yasaTupl[1] == None:
            secondIndexYasa = [yasaTupl[1]]
        else:
            secondIndexYasa = yasaTupl[1]
        # test if the first index is the same as the shiv
        if shivFileIndex in firstIndexYasa:
            if len(firstIndexYasa) == len(secondIndexYasa):
                return u'1'
            else:
                return u'0'


def getIntersectionOfAlignmentScores(shivScorePath):
    """ get the scores in bot of the paths mentioned and print how much they intersect """
    resultDict = {u'ALIGNMENT-QUALITY/': {u'correspond': {u'0': 0, u'1': 0}, u'not correspond': 0},
                  u'MISALIGNED/': {u'correspond': {u'0': 0, u'1': 0}, u'not correspond': 0},
                  u'NOT-FLAGGED/': {u'correspond': {u'0': 0, u'1': 0}, u'not correspond': 0},
                  u'QUALITY/': {u'correspond': {u'0': 0, u'1': 0}, u'not correspond': 0}}
    for folder in [u'ALIGNMENT-QUALITY/', u'MISALIGNED/', u'NOT-FLAGGED/', u'QUALITY/']:
        shivFiles = utilsOs.goDeepGetFiles(u'{0}{1}'.format(shivScorePath, folder))
        # get each file path
        for shivFilePath in shivFiles:
            yasaFilePath = shivFilePath.replace(u'/u/bhardwas/bt/', u'./yasa/yasa4BtOutput/').replace(u'.en', u'')
            # open each yasa and shiv file
            with open(shivFilePath) as shivFile:
                yasaIndexList = getIndexCorrespondToYasaScore(yasaFilePath)
                # get the shivendra model score
                # pass the header line
                shivLine = shivFile.readline()
                shivFileIndex = 0
                # get first line
                shivLine = shivFile.readline()
                while shivLine:
                    shivScore = str(shivLine.replace(u'\n', u'').split(u',')[-1])
                    # get the YASA score for that line index
                    yasaScore = getYasaScoreForIndex(shivFileIndex, yasaIndexList)
                    if shivScore == yasaScore:
                        resultDict[folder][u'correspond'][yasaScore] += 1
                    else:
                        resultDict[folder][u'not correspond'] += 1
                    # next line
                    shivLine = shivFile.readline()
                    shivFileIndex += 1
    for dom, res in resultDict.items():
        print(u'##############')
        print(dom)
        print(res)




